import { useLocation } from "react-router";
import { ArrowLeft  } from 'react-bootstrap-icons';
import { Link } from "react-router-dom";
import Card from 'react-bootstrap/Card';
import Badge from 'react-bootstrap/Badge';

import MainNavbar from '../MainNavbar.js';


function EventDetails() {

    const stateLocation = useLocation();
    const name = stateLocation.state.name;
    const exclusiveTag = stateLocation.state.exclusiveTag;
    const location = stateLocation.state.location;
    const date = stateLocation.state.date;
    const time = stateLocation.state.time;
    const image = stateLocation.state.image;
    const imageGallery = stateLocation.state.imageGallery;
    let arrImageGallery = [];
    if (imageGallery !== '') {
        arrImageGallery = imageGallery.split('||');
    }
    const eventDetails = stateLocation.state.details;
    let arrEventDetails = [];
    if (eventDetails !== '') {
        arrEventDetails = eventDetails.split('||');
    }

    return(
        <>
            <MainNavbar activeTab="/events"/>


            <div className="page-title side-title">
                <div className="mb-4"><Link to="/events"><ArrowLeft size="16"/>Back</Link></div>
                <h3>{name}</h3>
                <hr/>
            </div>

            <div className="container section eventDetails">
                <div className="row">
                    <div className="col-8">
                        <p><Badge bg="warning" text="dark">UPCOMING EVENT</Badge></p>
                    </div>
                    <div className="col-4">
                        test
                    </div>
                </div>
            </div>
 





  
            <div className="container section eventDetails">
                <div className="row">
                    <div className="col side-title">
                        <div className="mb-4"><Link to="/events"><ArrowLeft size="16"/>Back</Link></div>
                        
                        <div><h3>{name}</h3></div>
                        <hr/>
                    </div>
                </div>


                <div className="row">
                    <div className="col-4 eventImgContainer">
                        <div className="card">
                            <img src={image} className="card-img" alt={name}/>
                        </div>
                    </div>
                    <div className="col-8">
                        <div className="mb-4">
                            <Card>
                                <Card.Body>
                                    <p><span className="medium p-4">Date: </span> {date}</p>
                                    <p><span className="medium p-4">Time: </span> {time}</p>
                                </Card.Body>
                            </Card>
                        </div>
                        
                        <div className="mb-4">
                            <Card>
                                <Card.Body><span className="medium p-4">Location:</span> {location}</Card.Body>
                            </Card>
                        </div>

                        <div className="mb-4">
                            <Card>
                                <Card.Body><span className="medium p-4">Details:</span> 
                                
                                {arrEventDetails.map((detail, idx) => {
                                    return(<p key={idx}>{detail}</p>);
                                })}
                                
                                </Card.Body>
                            </Card>


                        </div>
                    </div>
                </div>

            </div>
        </>
    );
}

export default EventDetails;
